    static void dropInk(int[][] paper, int x, int y, int size) {
        if (size == 1) {
            // Small: only center
            if (isValid(x, y)) {
                paper[y][x]++;
            }
        } else if (size == 2) {
            // Medium: cross pattern with radius 1
            int[][] offsets = {
                {0, 0},
                {-1, 0}, {1, 0}, {0, -1}, {0, 1}
            };
            for (int[] offset : offsets) {
                int nx = x + offset[0];
                int ny = y + offset[1];
                if (isValid(nx, ny)) {
                    paper[ny][nx]++;
                }
            }
        } else if (size == 3) {
            // Large: diamond pattern with radius 2
            int[][] offsets = {
                {0, 0},
                {-1, 0}, {1, 0}, {0, -1}, {0, 1},
                {-2, 0}, {2, 0}, {0, -2}, {0, 2},
                {-1, -1}, {-1, 1}, {1, -1}, {1, 1}
