        if (index == 10) {
            return true;
        }

        int current = balls[index];

        // Try to put in B
        boolean canPutInB = true;
        if (!b.isEmpty() && b.get(b.size() - 1) > current) {
            canPutInB = false;
        }

        if (canPutInB) {
            b.add(current);
            if (canArrange(index + 1, b, c)) {
                return true;
            }
            b.remove(b.size() - 1);
        }

        // Try to put in C
        boolean canPutInC = true;
        if (!c.isEmpty() && c.get(c.size() - 1) > current) {
            canPutInC = false;
        }

        if (canPutInC) {
            c.add(current);
            if (canArrange(index + 1, b, c)) {
                return true;
            }
            c.remove(c.size() - 1);
        }

        return false;
    }
